import React, { useState, useEffect } from 'react';
import { Sparkles } from 'lucide-react';
import {
  Box,
  Paper,
  Typography,
  Checkbox,
  TableContainer,
  Table,
  TableHead,
  TableRow,
  TableCell,
  TableBody,
} from '@mui/material';

const holdingsData = [ /* your holdingsData array here (omitted for brevity) */ ];

const calculateNetGains = (gains) => {
  const stcgNet = gains.stcg.profits - gains.stcg.losses;
  const ltcgNet = gains.ltcg.profits - gains.ltcg.losses;
  const realised = stcgNet + ltcgNet;
  return { stcgNet, ltcgNet, realised };
};

const calculateOpportunityScore = (h) => {
  const st = h.stcg.gain < 0 ? Math.abs(h.stcg.gain) : 0;
  const lt = h.ltcg.gain < 0 ? Math.abs(h.ltcg.gain) : 0;
  return st + lt;
};

const Dashboard = () => {
  const [selected, setSelected] = useState([]);
  const [preHarvest, setPreHarvest] = useState({ stcgNet: 0, ltcgNet: 0, realised: 0 });
  const [postHarvest, setPostHarvest] = useState({ stcgNet: 0, ltcgNet: 0, realised: 0 });

  // Add opportunityScore to each holding and sort by descending opportunity
  const holdingsWithScore = holdingsData.map(h => ({
    ...h,
    opportunityScore: calculateOpportunityScore(h),
  }));
  const sortedHoldings = [...holdingsWithScore].sort((a, b) => b.opportunityScore - a.opportunityScore);
  const topOpportunity = sortedHoldings[0]?.coin;

  useEffect(() => {
    const stcgProfits = holdingsData.reduce((sum, h) => sum + (h.stcg.gain > 0 ? h.stcg.gain : 0), 0);
    const stcgLosses = holdingsData.reduce((sum, h) => sum + (h.stcg.gain < 0 ? -h.stcg.gain : 0), 0);
    const ltcgProfits = holdingsData.reduce((sum, h) => sum + (h.ltcg.gain > 0 ? h.ltcg.gain : 0), 0);
    const ltcgLosses = holdingsData.reduce((sum, h) => sum + (h.ltcg.gain < 0 ? -h.ltcg.gain : 0), 0);

    const initial = calculateNetGains({
      stcg: { profits: stcgProfits, losses: stcgLosses },
      ltcg: { profits: ltcgProfits, losses: ltcgLosses },
    });

    setPreHarvest(initial);
    setPostHarvest(initial);
  }, []);

  const toggleSelect = (coin) => {
    const updated = selected.includes(coin)
      ? selected.filter(c => c !== coin)
      : [...selected, coin];

    setSelected(updated);

    const selectedHoldings = holdingsData.filter(h => updated.includes(h.coin));
    const stcgProfits = selectedHoldings.reduce((sum, h) => sum + (h.stcg.gain > 0 ? h.stcg.gain : 0), 0);
    const stcgLosses = selectedHoldings.reduce((sum, h) => sum + (h.stcg.gain < 0 ? -h.stcg.gain : 0), 0);
    const ltcgProfits = selectedHoldings.reduce((sum, h) => sum + (h.ltcg.gain > 0 ? h.ltcg.gain : 0), 0);
    const ltcgLosses = selectedHoldings.reduce((sum, h) => sum + (h.ltcg.gain < 0 ? -h.ltcg.gain : 0), 0);

    const updatedPost = calculateNetGains({
      stcg: { profits: stcgProfits, losses: stcgLosses },
      ltcg: { profits: ltcgProfits, losses: ltcgLosses },
    });

    setPostHarvest(updatedPost);
  };

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" mb={2} display="flex" alignItems="center" gap={1}>
        Crypto Holdings Dashboard <Sparkles size={24} color="#ffb800" />
      </Typography>

      <Typography variant="subtitle1" mb={2}>
        Top Opportunity Coin: <strong>{topOpportunity || 'N/A'}</strong>
      </Typography>

      <Paper sx={{ mb: 3, p: 2 }}>
        <Typography variant="h6" gutterBottom>Pre-Harvest Net Gains</Typography>
        <Typography>Short-term: {preHarvest.stcgNet.toFixed(4)}</Typography>
        <Typography>Long-term: {preHarvest.ltcgNet.toFixed(4)}</Typography>
        <Typography>Total Realised: {preHarvest.realised.toFixed(4)}</Typography>
      </Paper>

      <Paper sx={{ mb: 3, p: 2 }}>
        <Typography variant="h6" gutterBottom>Post-Harvest Net Gains (Selected)</Typography>
        <Typography>Short-term: {postHarvest.stcgNet.toFixed(4)}</Typography>
        <Typography>Long-term: {postHarvest.ltcgNet.toFixed(4)}</Typography>
        <Typography>Total Realised: {postHarvest.realised.toFixed(4)}</Typography>
      </Paper>

      <TableContainer component={Paper}>
        <Table size="small" aria-label="holdings table">
          <TableHead>
            <TableRow>
              <TableCell padding="checkbox" />
              <TableCell>Coin</TableCell>
              <TableCell>Name</TableCell>
              <TableCell align="right">Current Price</TableCell>
              <TableCell align="right">Total Holding</TableCell>
              <TableCell align="right">Avg Buy Price</TableCell>
              <TableCell align="right">STCG Gain</TableCell>
              <TableCell align="right">LTCG Gain</TableCell>
              <TableCell align="right">Opportunity Score</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {sortedHoldings.map((h) => (
              <TableRow
                key={h.coin}
                hover
                selected={selected.includes(h.coin)}
                sx={{ cursor: 'pointer' }}
                onClick={() => toggleSelect(h.coin)}
              >
                <TableCell padding="checkbox">
                  <Checkbox
                    checked={selected.includes(h.coin)}
                    onChange={() => toggleSelect(h.coin)}
                    onClick={(e) => e.stopPropagation()} // Prevent row click toggle
                  />
                </TableCell>
                <TableCell>
                  <Box component="img" src={h.logo} alt={h.coin} sx={{ width: 24, height: 24, mr: 1, verticalAlign: 'middle' }} />
                  {h.coin}
                </TableCell>
                <TableCell>{h.coinName}</TableCell>
                <TableCell align="right">{h.currentPrice.toLocaleString(undefined, { maximumFractionDigits: 2 })}</TableCell>
                <TableCell align="right">{h.totalHolding.toLocaleString(undefined, { maximumFractionDigits: 6 })}</TableCell>
                <TableCell align="right">{h.averageBuyPrice.toLocaleString(undefined, { maximumFractionDigits: 6 })}</TableCell>
                <TableCell align="right" sx={{ color: h.stcg.gain >= 0 ? 'green' : 'red' }}>
                  {h.stcg.gain.toFixed(4)}
                </TableCell>
                <TableCell align="right" sx={{ color: h.ltcg.gain >= 0 ? 'green' : 'red' }}>
                  {h.ltcg.gain.toFixed(4)}
                </TableCell>
                <TableCell align="right">{h.opportunityScore.toFixed(4)}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default Dashboard;
